import './App.css';
import {BrowserRouter, Routes, Route } from 'react-scripts';
import Home from './Pages/Home';
import SavedRevipes from './Pages/SavedRevipes';
import CreateRecipe from './Pages/CreateRecipe';

function App() {
  return (
    <div className="App">
      App
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='/' element={<Home />} />
        <Route path='/' element={<CreateRecipe />} />
        <Route path='/' element={<SavedRevipes />} />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
